,"metadata":{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["day_membs_ride <- df %>% \n","  group_by(day_of_week, member_casual) %>% \n","  summarise(total_count = n(), .groups = \"drop\")\n","\n","day_membs_ride\n","\n","ggplot(data = day_membs_ride, aes(x = day_of_week, y = total_count))+\n","  geom_bar(aes(fill = member_casual), stat = 'identity', position = 'dodge')+\n","  labs(title = \"Count of Different Customers in a Week\")+\n","  theme(plot.title = element_text(hjust = 0.5))"]},{"cell_type":"markdown","id":"cd7dd580","metadata":{"papermill":{"duration":0.01509,"end_time":"2023-06-26T10:10:02.11793","exception":false,"start_time":"2023-06-26T10:10:02.10284","status":"completed"},"tags":[]},"source":["***The trend of cycling of casual riders is just the opposite of annual members. Casual riders populate more on weekends whereas the distribution of annual members is more on weekdays and follows a growth until Wednesday & slowly starts falling down. It seems maybe the annual members are taking subscriptions to commute to and fro from work and also the interest to cycle to work seems to fall down after midweek. Is it tiredness/ fatigue from work?***"]},{"cell_type":"code","execution_count":22,"id":"f0c464c9","metadata":{"execution":{"iopub.execute_input":"2023-06-26T10:10:02.152288Z","iopub.status.busy":"2023-06-26T10:10:02.150597Z","iopub.status.idle":"2023-06-26T10:10:02.765921Z","shell.execute_reply":"2023-06-26T10:10:02.76388Z"},"papermill":{"duration":0.634929,"end_time":"2023-06-26T10:10:02.768509","exception":false,"start_time":"2023-06-26T10:10:02.13358","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\u001b[1m\u001b[22m`summarise()` has grouped output by 'day_of_week'. You can override using the\n","`.groups` argument.\n"]},{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdeYBN5R/H8e+568ydfYx17Ma+ZslOkYq0KIpKyBLahKgo