rs riding in the morning increases from Sun - Tue  and starts to fall off until Friday. However, the rate of fall is not uniform and increases on Saturday though not significantly.\n","\n","2) Annual Members:\n","For annual members the increment in number of riders from Sun - Tue is pretty significant incomparison to casual riders and it starts to fall after Tue in a non-uniform way and keeps on falling even on Saturday.\n","\n","\n","**Afternoon:**\n","1) Casual Riders\n","\n","On Sunday and Saturday Afternoon, the number of casual riders increases drastically and falls down in Monday and remains consistent till Friday though shows a little of increment starting Wednesday till Friday.\n","\n","2) Annual Members\n","\n","The number of annual members riding is pretty consistent.\n","\n","**Evening:**\n","1) Casual Riders\n","\n","The number of riders increases on Monday incomparison to Sunday and remains pretty consistent until Thursday. The number of riders riding in the evening is more than in the Morning. But it keeps on falling after Thursday.\n","\n","2) Annual Members\n","\n","The number of annual riders also follows the same trend as casual rider but the number of annual rider is more than casual riders.\n","\n","**Night:**\n","1) Casual Rider\n","\n","The number of casual rider falls on Monday comparing to Sunday and increases pretty slowly until Friday and finally increases a bit drastically on Saturday.\n","\n","2) Annual Member\n","\n","The number of annual member riding during night is pretty consistent in comparison to casual rider\n","\n","\n","\n","\n","\n","\n","\n","\n","\n","\n"]},{"cell_type":"code","execution_count":29,"id":"1c080b54","metadata":{"execution":{"iopub.execute_input":"2023-06-26T10:10:40.915187Z","iopub.status.busy":"2023-06-26T10:10:40.913615Z","iopub.status.idle":"2023-06-26T10:10:41.878749Z","shell.execute_reply":"2023-06-26T10:10:41.876476Z"},"papermill":{"duration":0.989283,"end_time":"2023-06-26T10:10:41.881481","exception":fal