 theme(plot.title = element_text(hjust = 0.5))"]},{"cell_type":"markdown","id":"836f6d72","metadata":{"papermill":{"duration":0.020719,"end_time":"2023-06-26T10:10:41.92492","exception":false,"start_time":"2023-06-26T10:10:41.904201","status":"completed"},"tags":[]},"source":["***First Day of the Week: Sunday, Last Day: Saturday;***\n","\n","**Morning:**\n","1) Casual Riders:\n","The ride hours of casual riders riding in the morning is pretty consistent from Monday till Friday with just a little bit of increment on Tuesday and an unnoticebale fall until Friday. The ride is more for casual riders on weekends. \n","\n","2) Annual Members:\n","For annual members, there i sa little bit of increment in ride hours from Sunday till Tuesday and remains pretty consistent until Friday with a little bit of fall after Tuesday and keeps falling down at a quite insignificant consistent rate till Saturday.\n","\n","The ride length for casual riders is quite less on weekdays than annual members. But is significantly more on weekends.\n","\n","\n","**Afternoon:**\n","1) Casual Riders\n","\n","For casual riders, there is a sharp fall on ride length after the weekend. Starting Monday till Wednesday, the fall in ride length is moderate. Starting Wednesday till Friday, there is a moderate increment in ride length and there is a sharo increment on Saturday.\n","\n","2) Annual Members\n","\n","For annual members, there is an insignificant fall after the weekends. After that starting Monday till Friday, the ride length is pretty consistent and there is an insignificant increase in ride length on Saturday.\n","\n","We can see that the ride length for casual members is significantly more than annual members at all days of the week. So, though the number of member riders is more on afternoon, the ride length is more is more occupied by the causal member.\n","\n","**Evening:**\n","1) Casual Riders\n","\n","Starting Sunday till Tuesday there is an insignificant increment in ride lenght. Tuesday till Thursday, it's pretty consistent. On friday, there is an insignificant fall and there is a sharp increment on Saturday. So, Saturday is the busiest day of the week in terms of ride length.\n","\n","2) Annual Members\n","\n","Starting Sunday till Tuesday, the increment is pretty moderate. From Tuesday till Thursday, it is consistent. After Thursday, the fall is Moderate. On Saturdays and Sunday the ride length is almost equal.\n","\n","**Night:**\n","1) Casual Rider\n","\n","Monday till Thursday, the ride length is consistent. On Friday, there is a moderate increment and a sharp increment on Saturdays. After the weekends there is a fall i.e a fall on Monday.\n","\n","2) Annual Member\n","\n","For annual members, the ride length is consistent on Sunday till Friday. On Saturday there is an insignificant increment.\n","\n","Casual riders ride length is more at all days of the weeks comparing to annual members."]},{"cell_type":"markdown","id":"12a6d827","metadata":{"papermill":{"duration":0.020679,"end_time":"2023-06-26T10:10:41.965929","exception":false,"start_time":"2023-06-26T10:10:41.94525","status":"completed"},"tags":[]},"source":["#### Seasonal Analysis"]},{"cell_type":"code","execution_count":30,"id":"18b86f44","metadata":{"execution":{"iopub.execute_input":"2023-06-26T10:10:42.010746Z","iopub.status.busy":"2023-06-26T10:10:42.009377Z","iopub.status.idle":"2023-06-26T10:10:51.816017Z","shell.execute_reply":"2023-06-26T10:10:51.814408Z"},"papermill":{"duration":9.831062,"end_time":"2023-06-26T10:10:51.817793","exception":false,"start_time":"2023-06-26T10:10:41.986731","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["'data.frame':\t5102381 obs. of  19 variables:\n"," $ ride_id           : chr  \"AFDC60E4BD0755EB\" \"6DFBE82AEF4187C0\" \"3A2D92FB6FBAD9EE\" \"B0AD95376AEB3B2E\" ...\n"," $ rideable_type     : chr  \"electric_bike\" \"electric_bike\" \"electric_bike\" \"electric_bike\" ...\n"," $ started_at        : POS