bike_ride_hrs\n","\n","ggplot(bike_ride_hrs, aes(x = member_casual, y = total_hrs, fill = rideable_type))+\n","  geom_bar(stat = \"identity\", position = \"dodge\")+\n","  labs(x = \"Member Type\", y = \"Total Hours\", title = \"Preferred Bike By Different Customers\")+\n","  theme_classic()+\n","  scale_y_continuous(labels = scales::label_number(scale = 1e-3, suffix = \"k\"))+\n","  theme(plot.title = element_text(hjust = 0.5))"]},{"cell_type":"markdown","id":"a41f77e9","metadata":{"papermill":{"duration":0.022961,"end_time":"2023-06-26T10:10:54.846886","exception":false,"start_time":"2023-06-26T10:10:54.823925","status":"completed"},"tags":[]},"source":["***Here we can see that both the casual rider and the annual riders prefer classic bikes as their first choice and most of them spend more time riding these bikes. In case of annual members the second most preferred bike type is electric and no annual member seem to like riding the docked bikes. But in case of casual riders the second preference goes to the docked bikes and the third one is the electric.***"]},{"cell_type":"markdown","id":"8aea3bbf","metadata":{"papermill":{"duration":0.023424,"end_time":"2023-06-26T10:10:54.892969","exception":false,"start_time":"2023-06-26T10:10:54.869545","status":"completed"},"tags":[]},"source":["It can also be said the in Ashland Ave & 74th St where the casual riders are more prone to start should focus on all the three bike type availability and the Ashland Ave & 78th St start station should focus on meeting the demands for classic and electric bikes."]},{"cell_type":"code","execution_count":36,"id":"4942ec09","metadata":{"execution":{"iopub.execute_input":"2023-06-26T10:10:54.943152Z","iopub.status.busy":"2023-06-26T10:10:54.941598Z","iopub.status.idle":"2023-06-26T10:10:55.421257Z","shell.execute_reply":"2023-06-26T10:10:55.419771Z"},"papermill":{"duration":0.506341,"end_time":"2023-06-26T10:10:55.423366","exception":false,"start_time":"2023-06-26T10:10:54.917025","status